\echo Creating staging area :: `date`	
DROP SCHEMA IF EXISTS staging_area CASCADE;

CREATE SCHEMA staging_area;

SET search_path = staging_area, pg_catalog,public;

SET default_tablespace = '';

SET default_with_oids = false;



CREATE TABLE region (
    name character varying(75),
    code text,
    the_geom public.geometry,
    CONSTRAINT enforce_dims_the_geom CHECK ((public.ndims(the_geom) = 2)),
    CONSTRAINT enforce_geotype_the_geom CHECK (((public.geometrytype(the_geom) = 'MULTIPOLYGON'::text) OR (the_geom IS NULL))),
    CONSTRAINT enforce_srid_the_geom CHECK ((public.srid(the_geom) = 2136))
);

ALTER TABLE ONLY region ADD CONSTRAINT region_pkey PRIMARY KEY (code);

